import { Link } from 'react-router-dom';

function SelectUser() {
    return (
        <div className="row">
            <div className="selector-container col-6 col-sm-12">
                <Link to="/"><img alt="user" src="https://res.cloudinary.com/getapet/image/upload/v1618902177/web%20sources/teamwork_jqxzg6.png"/></Link>
            </div>
            <div className="selector-container col-lg6 col-sm-12">
                <Link to="/"><img alt="shelter" src="https://res.cloudinary.com/getapet/image/upload/v1618902177/web%20sources/animal-shelter_bz8fod.png"/></Link>
            </div>
        </div>
    );
}

export default SelectUser;
